class InvitePage extends React.Component {
  state = {
    previewChecked: false,
    title: '',
    description: '',
    amount: '',
    time: '',
    currency: 'JPY',
    cardSvgCode: svgCard
  };

  handleChange = name => event => {
    this.setState({ [name]: event.target.checked });
  };

  handleChangeTextField = name => event => {
    this.setState({
      [name]: event.target.value,
    });
  };

  render() {
    return (
      <Layout>
        <Header2 center>募集内容</Header2>
        <AuthStatusConsumer>
          {({result}) => (
            <>
              {result && <img src={result.user.photoURL} />}
            </>
          )}
        </AuthStatusConsumer>
        <Switch
          checked={this.state.previewChecked}
          onChange={this.handleChange('previewChecked')}
          value="checked"
          color="primary"
        />
        {
          this.state.previewChecked
          ? <InviteCard
            title={this.state.title}
            description={this.state.description}
            amount={this.state.amount}
            time={this.state.time} />
          : <TextFieldsWrapper>
            <TextField
              fullWidth
              id="title"
              label="勉強会のタイトル"
              value={this.state.title}
              onChange={this.handleChangeTextField('title')}
              margin="normal"
            />
            <TextField
              fullWidth
              id="description"
              label="勉強会の内容"
              value={this.state.description}
              onChange={this.handleChangeTextField('description')}
              multiline
              margin="normal"
            />
            <TextField
              fullWidth
              id="amount"
              label="勉強会のギャラ"
              value={this.state.amount}
              onChange={this.handleChangeTextField('amount')}
              InputProps={{
                startAdornment: (
                  <InputAdornment variant="filled" position="start">
                    ¥
                  </InputAdornment>
                ),
              }}
            />
            <TextField
              fullWidth
              id="time"
              label="目安時間"
              value={this.state.time}
              onChange={this.handleChangeTextField('time')}
              multiline
              margin="normal"
            />
          </TextFieldsWrapper> 
        }

        <RequestConsumer>
          {({postRequest, requestData}) => (
            <Button
              variant="contained"
              color="primary"
              onClick={() => postRequest(
                'https://demo9911358.mockable.io/create-invite',
                this.state,
                'inviteRequest'
              )}>
              募集する 
            </Button>
          )}
        </RequestConsumer>
      </Layout>
    );
  }
}

export default InvitePage
